import React from 'react';
import ReactDOM from 'react-dom';
import M from 'materialize-css';
import './index.css';

class Tab extends React.Component {
    render() {
        return (
            <div>
                <li class="tab col s3"><a href="">{this.props.name}</a></li>
            </div>
        );
    }
}

class Container extends React.Component {
    render() {
        return (
            <div class="div z-depth-5 row">
                <div class="col s12">
                    <ul class="tabs">
                        <Tab />
                        <Tab />
                        <Tab />
                    </ul>
                </div>
            </div>
        );
    }
}

class Tabs extends React.Component {
    render() {
        return (
            <div class="row">
                <div class="col s12">
                    <ul class="tabs">
                        <li class="tab col s3"><a href="#test1">Buy</a></li>
                        <li class="tab col s3"><a class="active" href="#test2">Sell</a></li>
                        <li class="tab col s3"><a href="#test4">Pool</a></li>
                    </ul>
                </div>
            </div>
        );
    }
}

class NavBar extends React.Component {
    render() {
        return (
            <div>
                <nav>
                    <div class="nav-wrapper pink lighten-3">
                        <a href="#" class="brand-logo center">MatejSwap</a>
                        <ul id="nav-mobile" class="right hide-on-med-and-down">
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }
}

/* class Menu extends React.Component {
    render() {
        return (
            <div class="nav-content center">
                <ul class="tabs">
                    <li class="tab"><a href="#test1">Buy</a></li>
                    <li class="tab"><a class="active" href="#test2">Sell</a></li>
                    <li class="tab"><a href="#test3">Pool</a></li>
                </ul>
            </div>
        );
    }
} */

class Page extends React.Component {
    render() {
        return (
            <div>
                <NavBar />
                <Container />
            </div>
        );
    }
}

ReactDOM.render(<Page />, document.getElementById("root"));
